 pie of fruit cake while you're there."</div>             </div>             </div>`)[0];

                var html_ae353c61530b00e5a39531f6bc98778a = $(`<div id="html_ae353c61530b00e5a39531f6bc98778a" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Mcdonald's</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Restaurant</p>                 <p style="margin:0;"><b>Rating:</b> 2.4 (312.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #6c757d; font-weight:bold;">0.04</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 51.87141172466856%; background: #6c757d; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"I have trouble with this particular McDonald's EVERY time I go there. The order is either wrong or all slapped together and falling apart. Yesterday, I ordered a family box with 2 x chicken Big Macs with extra pickles (extra $1.50 each) via self-serve, not (printer wasn't working). After a while, they called "150" a couple of people waiting mentioned we didn't know our numbers. She said "Family box" so over I went. She said, "We can't do chicken Big Macs." I asked why. She said "We're just not doing them, we can't make them" I asked why they cannot be made if it just means putting a chicken pattie where you'd usually put a beef one so if they have chicken patties it should be fine. She asked if I wanted to swap to any other burger. I declined and said that I would prefer not to as I didn't know what else those 2 family members wanted, and if we swapped, they'd have to muck around refunding the $3. She said "Okay we should be able to do that." And off she went. A while later, my order was ready, so I drove the 20 minutes home. I got home and unpacked the order. There were 3 Big Mac boxes as I ordered a normal one as well. Upon opening them, I discovered 2 "normal" Big Macs with minimal fillings. One had 1 pickle, and one had none! One Big Mac the same, but 3 beef patties! Then I find a soggy nugget box full of Big Mac Sauce, what looks to be a small serving of fries in medium-sized boxes. 4 usual extremely soda water tasting cokes when I ordered 1 vanilla coke. The people who wanted chicken Big Macs don't eat beef sooo another 20 minutes back to the shop. We spoke to a person in one of the important shirts, and she said they should have told me they can't do chicken Big Macs. I asked about swapping patties, but apparently, that can't happen as it is too expensive (isn't that why I paid extra for them). Asked why they are still available to order on the machine... no answer. Why is the sauce in a soggy box? Not sure. She offered a refund for the 2 Big Macs, which I took and said she asked if I wanted the other items (big mac, 2 "medium" fries, and cheeseburger) remade. I said yes as I live far away and don't want to eat them an hour after being cooked. She remarked that their food doesn't travel well. I said I allow for that. 20mins isn't great, but I do it. However, I'm not eating it after an unexpected return trip. So they remade those items (didn't replace my 2 sauces though, so no nugget sauce), and I went across to get 2 fillet burgers from KFC. Got home to eat my dinner and had to sit through 2 ads on TV advertising, you guessed it, CHICKEN BIG MACS!!!"</div>             </div>             </div>`)[0];

ith the high foot traffic, but not dirty ‚Äî and the staff did their best to cope with the demand, even if service was a bit sluggish. There‚Äôs definitely room for improvement there.  I understand this is likely a network-wide issue rather than something specific to the Bulahdelah shop, but unfortunately for them (and for me), it was at Oliver‚Äôs Bulahdelah that I learned a hard lesson: never again at Oliver‚Äôs. Fool me once, shame on you. Fool me twice, shame on me."</div>             </div>             </div>`)[0];

                var html_8ef7cef42519dee5ee05a7f203a5734d = $(`<div id="html_8ef7cef42519dee5ee05a7f203a5734d" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Hungry Jack's Burgers Port Macquarie</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Restaurant</p>                 <p style="margin:0;"><b>Rating:</b> 3.8 (1108.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #6c757d; font-weight:bold;">-0.09</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 45.59970238095239%; background: #6c757d; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"Came here back in January, was an 'interesting' experience, and I say that very loosely. I arrived here from the Gold Coast, as my daughter had been pestering me to go to Port Macquarie for an elite piano recital opportunity. Usually, my trips are a family-wide event, however, my wife was preoccupied with helping our son's education, who himself was preoccupied with his education.  Arrived here at around 7:20 in the morning on a Saturday, I recall that we intended to stop by here and get a quick breakie before breaking off and seeing the town. My daughter wanted to check things out before we made it to her recital. Around twenty minutes after our orders were placed, I asked if our orders were ready yet. The employees responded that they had 'forgotten about my order' and that they would 'get straight to it.'  Another half an hour later, my daughter was hungry, so she asked me to check up on our meal. This time, it seems that the original person who had been operating the front had been switched, so I asked her whether or not our order was ready. They told me to be patient and that rushing them would only cause more issues. I, of course, had had enough. I told them that we were hungry, had no breakfast, and would like a refund. It was THEN did they told me that my order was ready, and handed it to me. They told me that refunds were not possible, since the meal had already been prepared for me.  I wasn't going to complain anymore. It was almost 9 and I had to get my daughter to her trials before the deadline. We left in a rush and got into the car. When I opened it? I specifically asked that the cheese be removed from our burgers, since my daughter has a severe case of lactose intolerance. What I found was a patty that had cheese half scraped off.  We didn't eat breakfast that morning. My burger was perfectly fine, and honestly, I commend the team for that. Would go again, but I might just order for myself next time.  Cheers, Mike"</div>             </div>             </div>`)[0];

                var html_21c228c0e69dcdb3dc5986792323f3d4 = $(`<div id="html_21c228c0e69dcdb3dc5986792323f3d4" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Social Grounds Cafe</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Cafe</p>                 <p style="margin:0;"><b>Rating:</b> 4.6 (624.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.38</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 69.12337962962962%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"Great food, fair prices, no fuss.  Social Grounds in Port Macquarie is the kind of caf√© every town wishes it had‚Äîrelaxed, welcoming, and serving food that punches well above its weight.  The Brisket Hash is a standout. Tender, smoky brisket piled over crispy potatoes with just the right balance of richness and spice. It‚Äôs hearty, satisfying, and exactly what you want from a caf√© that takes its food seriously. The Vegan Hash holds its own too‚Äîfresh, well-seasoned, and full of texture, proving that meat-free doesn‚Äôt mean flavour-free.  The real surprise was the Hot Honey Burger‚Äîa juicy piece of chicken with a sweet-spicy honey glaze, crisp slaw, and soft bun. It‚Äôs got heat, crunch, and balance. Simple, but done really well.  Drinks are another strong point. The Chai Latte is warm and spiced without being overly sweet. The coffee is smooth and consistently good‚Äîclearly a focus for the team. And the ginger juice is a winner if you‚Äôre after something refreshing with a bit of a kick.  Best of all, everything is great value. Big portions, top ingredients, and prices that won‚Äôt make you flinch. Service is fast, friendly and down-to-earth.  Final verdict? Social Grounds does all the caf√© basics right‚Äîand then some. Good food, good coffee, good people. If you‚Äôre in Port Macquarie, don‚Äôt miss it.  ‚≠ê‚≠ê‚≠ê‚≠ê‚≠ê ‚Äì Quality without the pretence."</div>             </div>             </div>`)[0];

                var html_03978d773f4f9989086259520f6e12d5 = $(`<div id="html_03978d773f4f9989086259520f6e12d5" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Whalebone Wharf Seafood Restaurant</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Restaurant</p>                 <p style="margin:0;"><b>Rating:</b> 4.3 (1116.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.51</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 75.3784607984608%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"This is a charming spot by the water, perfect for those who enjoy a tranquil riverside setting. While we couldn‚Äôt secure a table right by the water, we still felt close to the serene beauty of the river. The atmosphere is excellent, though it can get a bit noisy when the restaurant is full‚Äîour little one certainly contributed to the lively ambiance!  The service was great. Our waiter was friendly and attentive, understanding the challenges of dining with young kids. He thoughtfully prioritized our child‚Äôs meal, which we really appreciated. On the other hand, a large man in an apron‚Äîpossibly the owner or manager‚Äîcame across as a bit cold and brusque, which was a minor letdown. We had a brief interaction with him at the start. The only time I saw he smiled tiny bit while we were there was when he took order from a group of men.  As for the food, it was good but didn‚Äôt quite meet the expectations for a restaurant of this caliber. The oysters were the standout dish‚Äîfresh and delicious. However, the scallops, though tasty, were disappointingly small, with one being about a quarter the size of what we‚Äôve had elsewhere. The fish was well-cooked, but the seafood chowder leaned more toward a potato soup. The lettuce salad was a pleasant surprise and very enjoyable. I also ordered a margarita, which looked fantastic but was just average in taste‚Äîthough great margaritas in Australia are rare outside of authentic Mexican establishments.  Pricing is very reasonable (~$120 per head including drinks), especially given the beautiful views and overall atmosphere.  Overall, we had a lovely experience and are glad we visited. While it‚Äôs not a place we‚Äôd rush back to, it‚Äôs worth a try for the view and ambiance."</div>             </div>             </div>`)[0];

                var html_308ca4224112a05175b7cb4ec6be6e9d = $(`<div id="html_308ca4224112a05175b7cb4ec6be6e9d" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">The Big Oyster & Seafood</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Cafe</p>                 <p style="margin:0;"><b>Rating:</b> 4.3 (421.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.25</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 62.74379145854145%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"From the looks of the front, you may drive past this little seafood shack. But don't, you'll be missing out on a great lunchtime experience. They have a small but nice range of fresh seafood for sale, but the real treat is out the back. Their fresh cooked seafood was wonderful, and sitting on the pontoon with fish and seabirds waiting for their share was a great way to relax for a while. Some reviews have stated that the prices were a bit high, and if you are comparing them with the local main street fish and chip shop, I would agree. However,  just like any restaurant, you are paying for the ambience. Sitting on the water with a beautiful view, the wildlife and fresh air is a wonderful memory of our visit. The lady who served us was excellent,  friendly, and helpful. If you ask, she will tell you what parts of your meal are suitable to feed the multitude of fish and seabirds, or if you ask really nicely she may even give you some scraps from the kitchen if available. I hope you enjoy it as much as my wife and I did."</div>             </div>             </div>`)[0];

d too much salt used in preparation. We were all gagging for water after eating. Helped with the beautiful beer. So nice to have a decent pint on the menu. Personally, I think pub menus should be approached with the attitude of what can be mucked up the least. Steak is always going to be an issue as it needs to be cooked perfectly and lets face it it is expensive. So if the meal is not expensive then the steak will be rubbish. Table staff were efficient but not effusive. A great spot and so close to the beach."</div>             </div>             </div>`)[0];

                var html_6dbf09910cf9367bfc81524569b11fac = $(`<div id="html_6dbf09910cf9367bfc81524569b11fac" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Gemelli Italian</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Restaurant</p>                 <p style="margin:0;"><b>Rating:</b> 4.3 (1810.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.41</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 70.4271850949976%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"Overall This restaurant takes the rare title of being the best Italian restaurant I've ever visited as far as my memory serves. You will be treated to rich, Italian pizza and pasta in a lively environment that is welcoming for the young & hungry, the couple overdue for a date night, and the group of friends having a reunion.  The Meal In a few words, Satisfying authentic Italian food that artfully balances flavour and texture from start to finish. Entree - Bruschetta - The bruscetta was delicious, with crunchy but tender bread topped with cherry tomatos full of flavour. The surprisingly powerful addition is the parmesan cheese ontop. What a combo!  Main 1 - Pizza - Che Stupido - I needed to research the translation for this one and apparently, it means "how stupid!". The pizza was anything but what name suggests though. The Fior di latte mozzarella was a great balance against the stronger meat flavours from the leg ham, salami, pork and chilli sausage (and it is not overly spicy). The tomato and basil tie these flavours all together for a filling and flavourful pizza.  Main 2 - Gnocchi al forn - This dish was undoubtedly in my eyes, the star of the show. The Napoli sauce, buffalo mozzarella and basil are balanced perfectly to be overflowing with flavour. The gnocchi itself is something that should be elaborated on in an essay on how important texture is to a dish. Never have I had such melt-in-your-mouth gnocchi before. Topped with melted parmesan and mozzarella, these pillows of happiness were so delicious and easy to eat that we actually ordered a second plate. We simply could not resist the temptation!  Drink - All of this was washed down with a bottle of Langmeil shiraz. This delicious red, alongside the table water, kept us well hydrated through the dining experience. The only aspect that could've enhanced this would have been more emphasis on the presenting of the bottle before opening it.  Atmosphere & Service The atmosphere here is warm and engaging. Multiple chefs were seen skilfully working the woodfired oven in the middle of the restaurant which made for an engaging environment but never an overly distracting one. The chairs and tables are sturdy and comfortable also. The staff move about quickly and quietly, giving the place a distinguished professional feel. We never felt unwelcome or rushed as we made our order.  Booking & Wait times You will need to book a table in busy periods (we visited on a Friday evening) as the place's popularity may see you missing out if you don't think ahead. For 2 people, you will have about 1hr 30min to have your meal. The wait times were never noticeably long, even when the place was at full capacity. Regardless, the wait was worth it.  Cost This place is not a budget restaurant, and you will likely find cheaper pizzas and pasta dishes in other venues. However, you will see you are paying for top quality food, and it is something you will likely find yourself budgeting for once you have tasted it for yourself.  Summary (TL;DR) This is a popular premium Italian dining experience worthy of the price. The staff, decor and atmosphere are great and the food (especially gnocchi) is phenomenal. Will definitely return here."</div>             </div>             </div>`)[0];

                var html_beb2f0e7274ebc011795d77c791d033d = $(`<div id="html_beb2f0e7274ebc011795d77c791d033d" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Paradise Resort Gold Coast</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Restaurant</p>                 <p style="margin:0;"><b>Rating:</b> 4.0 (4340.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.33</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 66.27716272685217%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"Honest Review from an Adult Guest in a Family Group  I recently stayed at Paradise Resort Gold Coast for six nights as part of a larger family booking. While the resort is clearly designed with families in mind, I wouldn‚Äôt personally stay here again as a couple. The environment is overwhelmingly geared toward young children, and unfortunately, a lot of parents seemed to allow their kids to run wild without much consideration for other guests.  Noise was a major issue ‚Äî children were running and screaming in the hallways as early as 5:30am, and jumping around in rooms well past midnight made it difficult to sleep.  That said, the resort does offer great facilities for families with kids, and little ones will love it. From my perspective, however, some areas are tired and in need of maintenance. The pools seemed over-chlorinated, the spa was constantly overcrowded, and pool rules were rarely enforced. My niece even developed a rash from the water.  The rooms were comfortable ‚Äî especially the beds ‚Äî and daily housekeeping was appreciated. But the bathrooms felt outdated, with no exhaust fan and a shower design that soaked the entire floor due to the absence of a curtain.  I would suggest a maximum stay of around 4 nights and would not recommend it for adults in a family group who don‚Äôt have young kids ‚Äî it‚Äôs probably better for them to stay elsewhere and just visit during the day.  That said, there were some definite positives: the resort‚Äôs cashless system is super convenient, and the food was absolutely fantastic ‚Äî I couldn‚Äôt fault it. If breakfast is included in your rate, I highly recommend heading into Penguins even when it‚Äôs busy. If you‚Äôre paying separately, their hot breakfast options are surprisingly affordable.  Final Verdict: I would recommend Paradise Resort only to families with young children under 12. It‚Äôs a great option if you‚Äôre looking for a kid-focused getaway, but not ideal for couples or child-free travellers looking for a peaceful stay."</div>             </div>             </div>`)[0];
